import React, { Component,useEffect } from 'react';
import './contactcut.css';
import Aos from 'aos';
import Img from './contact1.jpg';
import {Link} from 'react-scroll';

const ContactCut = () => {

    return (
        
    	<div id="contact">
      <div style={{backgroundColor:'#f3f3f1',width:140,height:130,position:'absolute',top:0,left:0}}></div>
      <p style={{fontSize:50,fontWeight:'bold',position:'absolute',top:20,left:100}}>That's it! Now it's
      <br/>
      your turn to say hi.</p>
        
            
        </div>
    );
}

export default ContactCut;
